import React, { useState } from 'react';
import Modal from './Modal';

function Header() {
  const [isRegisterOpen, setRegisterOpen] = useState(false);
  const [isLoginOpen, setLoginOpen] = useState(false);

  const openRegisterModal = () => setRegisterOpen(true);
  const closeRegisterModal = () => setRegisterOpen(false);

  const openLoginModal = () => setLoginOpen(true);
  const closeLoginModal = () => setLoginOpen(false);

  return (
    <header className="header">
      <div className="left-side">
        <input className="search-bar" type="text" placeholder="Search" />
        <button className="search-button">
          {/* <img className="search-icon" src="icons/search.svg" alt="Search Icon" /> */}
          <div className="tooltip">Search</div>
        </button>
      </div>

      <div className="right-side">
        <button className='register-button' onClick={openRegisterModal}>Зарегистрироваться</button>
        <button className='login-button' onClick={openLoginModal}>Войти</button>
      </div>
      
      {/* Модальное окно для регистрации */}
      <Modal isOpen={isRegisterOpen} onClose={closeRegisterModal} title="Регистрация">
        <form>
          <input type="text" placeholder="Username" required />
          <input type="password" placeholder="Password" required />
          <button type="submit">Зарегистрироваться</button>
        </form>
      </Modal>

      {/* Модальное окно для входа */}
      <Modal isOpen={isLoginOpen} onClose={closeLoginModal} title="Вход">
        <form>
          <input type="text" placeholder="Username" required />
          <input type="password" placeholder="Password" required />
          <button type="submit">Войти</button>
        </form>
      </Modal>
    </header>
  );
}

export default Header;
